tables.table_schema:
CREATE TABLE quantum_error_correction_results (
    result_id UUID PRIMARY KEY,
    algorithm_name VARCHAR(255),
    error_count INT,
    correction_technique TEXT
);

CREATE TABLE quantum_error_correction_logs (
    log_id UUID PRIMARY KEY,
    result_id UUID REFERENCES quantum_error_correction_results(result_id),
    log_timestamp TIMESTAMP,
    log_details TEXT
);

CREATE TABLE QuantumErrors (
  error_id INT PRIMARY KEY,
  error_type VARCHAR(50),
  error_description TEXT
);

CREATE TABLE QuantumCodes (
  code_id INT PRIMARY KEY,
  code_type VARCHAR(50),
  code_description TEXT
);

CREATE TABLE quantum_error_correction (
  error_id INT PRIMARY KEY,
  description TEXT,
  algorithm_used TEXT
);

CREATE TABLE error_types (
  type_id INT PRIMARY KEY,
  error_name TEXT,
  probability FLOAT
);

CREATE TABLE qubits (
  qubit_id INT PRIMARY KEY,
  error_type INT,
  foreign key (error_type) references error_types(type_id)
);

CREATE TABLE error_correction_results (
    result_id UUID PRIMARY KEY,
    quantum_algorithm_id UUID,
    error_correction_code TEXT,
    number_of_qubits INT,
    error_probability DOUBLE PRECISION
);

CREATE TABLE quantum_algorithms (
    algorithm_id UUID PRIMARY KEY,
    algorithm_name TEXT
);

CREATE TABLE error_correction_codes (
    code_id UUID PRIMARY KEY,
    code_name TEXT,
    code_description TEXT
);

CREATE TABLE qubit_results (
    result_id UUID,
    qubit_id UUID,
    error_detected BOOLEAN,
    PRIMARY KEY (result_id, qubit_id)
);

CREATE TABLE qubits (
    qubit_id UUID PRIMARY KEY,
    qubit_state TEXT
);
